export const ADD_NOTIFICATION = 'ADD_NOTIFICATION';

export const login = {
    type: LOGIN
}

export const signup = {
    type: SIGN_UP
}

export function addNotification(tweet) {
    return {
        type: ADD_NOTIFICATION,
        tweet
    }
}
